    let _fslex_code p (buff : StringBuilder) _fslex_state (lexbuf : Microsoft.FSharp.Text.Lexing.LexBuffer<_>) =
//        System.Diagnostics.Trace.WriteLine
//            <| sprintf "--- Begin matching in rule 'code' (Position = %i) ---" lexbuf.BufferScanPos

        match _fslex_tables.Interpret (_fslex_state, lexbuf) with
        | 0 ->
            CODE (buff.ToString ())
        | 1 ->
            buff.Append (lexeme lexbuf) |> ignore
            code p buff lexbuf |> ignore
            buff.Append "}" |> ignore
            code p buff lexbuf
        | 2 ->
            buff.Append (lexeme lexbuf) |> ignore
            code p buff lexbuf
        | 3 ->
            buff.Append (lexeme lexbuf) |> ignore
            codestring buff lexbuf |> ignore
            code p buff lexbuf
        | 4 ->
            newline lexbuf
            buff.AppendLine () |> ignore
            code p buff lexbuf
        | 5 ->
            buff.Append (lexeme lexbuf) |> ignore
            code p buff lexbuf
        | 6 ->
            buff.Append (lexeme lexbuf) |> ignore
            code p buff lexbuf
        | 7 ->
            EOF
        | 8 ->
            buff.Append (lexeme lexbuf).[0] |> ignore
            code p buff lexbuf
        | invalidAction ->
            failwithf "Invalid action index (%i) specified for the 'code' lexer rule." invalidAction
    
    _fslex_code p buff 28 lexbuf
    
(* Rule: codestring *)
and codestring buff (lexbuf : Microsoft.FSharp.Text.Lexing.LexBuffer<_>) =
    let _fslex_codestring (buff : StringBuilder) _fslex_state (lexbuf : Microsoft.FSharp.Text.Lexing.LexBuffer<_>) =
//        System.Diagnostics.Trace.WriteLine
//            <| sprintf "--- Begin matching in rule 'codestring' (Position = %i) ---" lexbuf.BufferScanPos

        match _fslex_tables.Interpret (_fslex_state, lexbuf) with
        | 0 ->
            buff.Append (lexeme lexbuf) |> ignore
            codestring buff lexbuf
        | 1 ->
            buff.Append (lexeme lexbuf) |> ignore
            buff.ToString ()
        | 2 ->
            newline lexbuf
            buff.AppendLine () |> ignore
            codestring buff lexbuf
        | 3 ->
            buff.Append (lexeme lexbuf) |> ignore
            codestring buff lexbuf
        | 4 ->
            failwith "Unterminated string in code."
        | 5 ->
            buff.Append (lexeme lexbuf).[0] |> ignore
            codestring buff lexbuf
        | invalidAction ->
            failwithf "Invalid action index (%i) specified for the 'codestring' lexer rule." invalidAction
    
    _fslex_codestring buff 17 lexbuf
    
(* Rule: comment *)
and comment p (lexbuf : Microsoft.FSharp.Text.Lexing.LexBuffer<_>) =
    let _fslex_comment p _fslex_state (lexbuf : Microsoft.FSharp.Text.Lexing.LexBuffer<_>) =
//        System.Diagnostics.Trace.WriteLine
//            <| sprintf "--- Begin matching in rule 'comment' (Position = %i) ---" lexbuf.BufferScanPos

        match _fslex_tables.Interpret (_fslex_state, lexbuf) with
        | 0 ->
            comment p lexbuf
        | 1 ->
            try string lexbuf.StartPos (StringBuilder 100) lexbuf
            with Failure s ->
                let msg = s + System.Environment.NewLine + sprintf "Error while processing string nested in comment started at (%d,%d)." p.pos_lnum (p.pos_cnum - p.pos_bol)
                raise <| exn msg
            |> ignore
            comment p lexbuf
        | 2 ->
            try comment p lexbuf
            with Failure s ->
                let msg = s + System.Environment.NewLine + sprintf "Error while processing nested comment started at (%d,%d)." p.pos_lnum (p.pos_cnum - p.pos_bol)
                raise <| exn msg
            |> ignore
            comment p lexbuf
        | 3 ->
            newline lexbuf
            comment p lexbuf
        | 4 ->
            ()
        | 5 ->
            let msg = sprintf "End of file in comment started at (%d,%d)." p.pos_lnum (p.pos_cnum - p.pos_bol)
            raise <| exn msg
        | 6 ->
            comment p lexbuf
        | 7 ->
            comment p lexbuf
        | invalidAction ->
            failwithf "Invalid action index (%i) specified for the 'comment' lexer rule." invalidAction
    
    _fslex_comment p 0 lexbuf
    
(* Rule: string *)
and string p buff (lexbuf : Microsoft.FSharp.Text.Lexing.LexBuffer<_>) =
    let _fslex_string p (buff : StringBuilder) _fslex_state (lexbuf : Microsoft.FSharp.Text.Lexing.LexBuffer<_>) =
//        System.Diagnostics.Trace.WriteLine
//            <| sprintf "--- Begin matching in rule 'string' (Position = %i) ---" lexbuf.BufferScanPos

        match _fslex_tables.Interpret (_fslex_state, lexbuf) with
        | 0 ->
            newline lexbuf
            string p buff lexbuf
        | 1 ->
            buff.Append (escape (lexeme lexbuf).[1]) |> ignore
            string p buff lexbuf
        | 2 ->
            let s = lexeme lexbuf
            trigraph s.[1] s.[2] s.[3]
            |> buff.Append
            |> ignore
            string p buff lexbuf
        | 3 ->
            STRING <| buff.ToString ()
        | 4 ->
            newline lexbuf
            buff.AppendLine () |> ignore
            string p buff lexbuf
        | 5 ->
            buff.Append (lexeme lexbuf) |> ignore
            string p buff lexbuf
        | 6 ->
            let msg = sprintf "End of file in string started at (%d,%d)." p.pos_lnum (p.pos_cnum - p.pos_bol)
            raise <| exn msg
        | 7 ->
            buff.Append (lexeme lexbuf).[0] |> ignore
            string p buff lexbuf
        | invalidAction ->
            failwithf "Invalid action index (%i) specified for the 'string' lexer rule." invalidAction
    
    _fslex_string p buff 44 lexbuf
    
(* Rule: token *)
and token (lexbuf : Microsoft.FSharp.Text.Lexing.LexBuffer<_>) =
    let _fslex_token _fslex_state (lexbuf : Microsoft.FSharp.Text.Lexing.LexBuffer<_>) =
//        System.Diagnostics.Trace.WriteLine
//            <| sprintf "--- Begin matching in rule 'token' (Position = %i) ---" lexbuf.BufferScanPos

        match _fslex_tables.Interpret (_fslex_state, lexbuf) with
        | 0 ->
            RULE
        | 1 ->
            PARSE
        | 2 ->
            EOF
        | 3 ->
            LET
        | 4 ->
            AND
        | 5 ->
            let s = lexeme lexbuf
            CHAR (if s.[1] = '\\' then escape s.[2] else s.[1])
        | 6 ->
            let s = lexeme lexbuf
            CHAR (trigraph s.[2] s.[3] s.[4])
        | 7 ->
            let s = lexeme lexbuf
            CHAR (hexgraph s.[3] s.[4])
        | 8 ->
            let s = lexeme lexbuf
            CHAR (unicodegraph_short s.[3..6])
        | 9 ->
            let s = lexeme lexbuf
            match unicodegraph_long s.[3..10] with
            | None, c -> CHAR c
            | Some _ , _ -> failwith "Unicode characters needing surrogate pairs are not yet supported by this tool."
        | 10 ->
            let s = (lexeme lexbuf).[2..3]
            UNICODE_CATEGORY s
        | 11 ->
            let p = lexbuf.StartPos
            let buff = StringBuilder 100
            // adjust the first line to get even indentation for all lines w.r.t. the left hand margin
            buff.Append (String.replicate (lexbuf.StartPos.Column + 1) " ") |> ignore
            code p buff lexbuf
        | 12 ->
            string lexbuf.StartPos (StringBuilder 100) lexbuf
        | 13 ->
            token lexbuf
        | 14 ->
            newline lexbuf
            token lexbuf
        | 15 ->
            IDENT (lexeme lexbuf)
        | 16 ->
            BAR
        | 17 ->
            DOT
        | 18 ->
            PLUS
        | 19 ->
            STAR
        | 20 ->
            QMARK
        | 21 ->
            EQUALS
        | 22 ->
            LBRACK
        | 23 ->
            RBRACK
        | 24 ->
            LPAREN
        | 25 ->
            RPAREN
        | 26 ->
            UNDERSCORE
        | 27 ->
            HAT
        | 28 ->
            DASH
        | 29 ->
            comment lexbuf.StartPos lexbuf
            |> ignore
            token lexbuf
        | 30 ->
            token lexbuf
        | 31 ->
            unexpected_char lexbuf
        | 32 ->
            EOF
        | invalidAction ->
            failwithf "Invalid action index (%i) specified for the 'token' lexer rule." invalidAction
    
    _fslex_token 60 lexbuf
    
